import css from './style.module.css';
import LandingImage from '../../assets/svg/LandingImage.svg';


const Home = () => {
    return (
        <div className={css.splitScreen}>
            <div className={css.leftPane}>
            <img src={ReactLogo} alt="React Logo" />
            </div>
            <div className={css.rightPane}>
                <p>test1</p>
            </div>
        </div>
    )
}

export default Home;
